import React from "react";
import { Typography, ListItemText, Button, Link, Grid } from "@mui/material";

function Registration() {
  return (
    <div id="item_5" className="Registration" style={{ height: "30vh" }}>
      <Grid container textAlign="center" alignItems="center">
        <Typography variant="h4"></Typography>
        <Typography></Typography>
        <ListItemText
          primary="参加登録"
          primaryTypographyProps={{
            color: "#222222",
            variant: "h4",
          }}
          secondary="大会の概要およびプログラムを下記からダウンロードできます。"
          secondaryTypographyProps={{
            color: "red",
            variant: "h6",
          }}
        />
        <Button variant="contained" size="large">
          <Link href="src\dawnload\img.png" download="img.png">
            <Typography style={{ color: "white" }}>
              サンプルCSVダウンロード
            </Typography>
          </Link>
        </Button>
      </Grid>
    </div>
  );
}

export default Registration;
